import React from 'react';
let image1 = 'data:image/jpeg;base64,';
let image2 = 'data:image/jpeg;base64,';

export default class LandingPage extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      imageURLS : [image1, image2]
    };  
  };
  render(){
    let images = this.renderImgs();
    return (<div>
            {images}
          </div>);
  };
  renderImgs(){
    return this.state.imageURLS.map((imageURL, index) => {
      return <img key={index} className={'imgLanding'} src={imageURL} />
    });
  };
  getDefaultParagraphData(){
    let para = 'My name is Shakeil. I am a designer, artist, activist, and visual problem solver. Above all, I am a curious individual who is always looking for new ways of using visual media to make the world more beautiful, thoughtful, and engaging. \n\nSince I started using new media tools at age 12, I have created posters for world famous musicians, founded a design and research project about police brutality, won best senior thesis in the Visual Studies program at UPenn, got trapped in the internet, and even worked at the first social impact focused accelerator in the country. \nIn the coming years, I hope to continue to put out content that pushes our current understanding of the visual world, and work on projects that challenge assumptions an alter perceptions.';
    return para;
  };
};

